pragma solidity ^0.4.24;

import "./VuupleToken.sol";
import "./VuupleAdmins.sol";

import '../../node_modules/openzeppelin-solidity/contracts/crowdsale/emission/MintedCrowdsale.sol';


contract VuupleICO is MintedCrowdsale {
        VuupleAdmins private vuupleAdmin;

      constructor
          (

              uint256 _rate,
              address _wallet,
              VuupleToken _token,
              VuupleAdmins _adminAddress 

          )
          public
          Crowdsale(_rate, _wallet, _token)
         {
        vuupleAdmin = _adminAddress;

          }
  modifier onlyVuupleAdmin() {
        require(vuupleAdmin.isVuupleAdmin(msg.sender));
        _;
    }
            /**
   * @dev Extend parent behavior requiring the msg sender to be vuuple admin account 
   * @param beneficiary Token purchaser
   * @param weiAmount Amount of wei contributed
   */
  function _preValidatePurchase(
    address beneficiary,
    uint256 weiAmount
  )
    internal
    onlyVuupleAdmin
    view
  {
    super._preValidatePurchase(beneficiary, weiAmount);
  }
}

